        public int FindMaxConsecutiveOnes(int[] nums)
        {
            if(nums == null)
            {
                return 0;
            }

            int maxOnes = 0;
            int tempMaxOnes = 0;

            foreach (int num in nums)
            {
                if(num == 1)
                {
                    ++tempMaxOnes;
                }
                else
                {
                    if (tempMaxOnes > maxOnes)
                    {
                        maxOnes = tempMaxOnes;
                    }
                    tempMaxOnes = 0;
                }
            }

            if (tempMaxOnes > maxOnes)
            {
                return tempMaxOnes;
            }

            return maxOnes;
        }
    }
